.relative {
  position: relative;
  height: 21.5px;
  width: 19700px;
  background-color: "white";
}
.monthitem {
  display: inline-block;
  width: 275px;
  height: 21.5px;
  text-align: center;
  border: gray;
  background-color: #E8562A;
  color: #fff;
  cursor: pointer;
  font-weight: bold;
}
.parent {
  position: relative;
}
.container {
  display: flex;
  flex-wrap: wrap;
  width: 100%;
}
/* Loading Circle */
.loading-circle {
  position: absolute;
  top: 85%;
  left: 50%;
  transform: translate(-50%, -50%);
  width: 40px;
  height: 40px;
  border-radius: 50%;
  border: 4px solid #f3f3f3;
  border-top: 4px solid #ff0808;
  animation: spin 1s linear infinite;
}
@keyframes spin {
  0% {
    transform: translate(-50%, -50%) rotate(0deg);
  }
  100% {
    transform: translate(-50%, -50%) rotate(360deg);
  }
}
.flowing-gradient-button {
  background: linear-gradient(to right, #FF0000, #FFD600, #B93333);
  color: white;
  animation: flowing-gradient 10s infinite alternate;
}
@keyframes flowing-gradient {
  0% {
    background-position: 0% 50%;
  }
  50% {
    background-position: 100% 50%;
  }
  100% {
    background-position: 0% 50%;
  }
}
.rdt_TableHead {
  background-color: #B93333;
}
